import React from 'react';
import styled from 'styled-components';
import FacultyButtons from './FacultyButtons';

const HomeContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const Home = () => {
  return (
    <HomeContainer>
      <FacultyButtons />
    </HomeContainer>
  );
};

export default Home;
